const e='{"head": [{"t": "h1", "c": "Antoine de Saint-Exup\xE9ry", "p": 0}, {"t": "h2", "c": "Le petit prince", "p": 1}], "body": [{"t": "h2", "c": "Chapitre XII", "p": 264}, {"t": "text", "c": ["Et le petit prince s\u2019en fut."], "p": 264}, {"t": "text", "c": ["\xAB Les grandes personnes sont d\xE9cid\xE9ment bien bizarres \xBB, se dit-il simplement en lui-m\xEAme durant son voyage."], "p": 265}, {"t": "text", "c": ["La plan\xE8te suivante \xE9tait habit\xE9e par un buveur.", "Cette visite fut tr\xE8s courte, mais elle plongea le petit prince dans une grande m\xE9lancolie :"], "p": 267}, {"t": "text", "c": ["- Que fais-tu l\xE0 ? dit-il au buveur, qu\u2019il trouva install\xE9 en silence devant une collection de bouteilles vides et une collection de bouteilles pleines."], "p": 268}, {"t": "text", "c": ["- Je bois, r\xE9pondit le buveur, d\u2019un air lugubre."], "p": 269}, {"t": "text", "c": ["- Pourquoi bois-tu ? lui demanda le petit prince."], "p": 270}, {"t": "text", "c": ["- Pour oublier, r\xE9pondit le buveur."], "p": 271}, {"t": "text", "c": ["- Pour oublier quoi ?"], "p": 272}, {"t": "text", "c": ["S\u2019enquit le petit prince qui d\xE9j\xE0 le plaignait."], "p": 273}, {"t": "text", "c": ["- Pour oublier que j\u2019ai honte, avoua le buveur en baissant la t\xEAte."], "p": 274}, {"t": "text", "c": ["- Honte de quoi ? S\u2019informa le petit prince qui d\xE9sirait le secourir."], "p": 275}, {"t": "text", "c": ["- Honte de boire ! Acheva le buveur qui s\u2019enferma d\xE9finitivement dans le silence."], "p": 276}]}';export{e as default};
